import classNames from "classnames/bind";
import { useState } from "react";

import styles from "./CreateAccount.module.scss";
import Input from "../../../components/Input";
import Button from  "../../../components/Button";
import Product from "./MoreProduct";
import { postAccount } from "../../../Services/account";

const cx =classNames.bind(styles);

function Account() {

    const [Name, setName] = useState(null);
    const [Email, setEmail] = useState(null);
    const [Birthday, setBirthday] = useState(null);
    const [From, setFrom] = useState(null);
    const [Password, setPassword] = useState(null);
    const [Majors, setMajors] = useState(null);
    const [Maxim, setMaxim] = useState(null);
    const [Describe, setDescribe] = useState(null);
    const [CV, setCV] = useState(null);
    const [Image, setImages] = useState(null);
    const [Logo, setLogo] = useState(null);
    const [IconLogo, setIconLogo] = useState(null);
    const [Job, setJob] = useState(null);
    const [Phone, setPhone] = useState(null);
    const [Language, setLanguage] = useState(null);

    const handleJob = (data) => {
        setJob(data);
    };
    const handlePhone = (data) => {
        setPhone(data);
    };
    const handleLanguage = (data) => {
        setLanguage(data);
    };
    
    const handleUpAccount = async () => {
        try {
            const body = {
                Name,
                Email,
                Image,
                Birthday,
                Phone,
                From,
                Language,
                Password,
                Majors,
                Maxim,
                Describe,
                CV,
                Logo,
                IconLogo,
                Job
            };
            const result =  postAccount(body);        
            console.log(result);
        } catch (error) {
            console.log(error);
        }


    }

    return ( 
        <form action="" className={cx("Container")}>
            <article className={cx("itemLeft")}>
                <Input 
                    name="Name"
                    type="text"
                    required
                    title="Can not be empty"
                    id="Name"
                    onChange={(e) => setName(e.target.value)}
                />
                <Input 
                    name="Email"
                    type="email"
                    required
                    title="Can not be empty"
                    id="Email"
                    onChange={(e) => setEmail(e.target.value)}
                />
                <Input 
                    name="Birthday"
                    type="date"
                    required
                    title="Can not be empty"
                    id="Birthday"
                    onChange={(e) => setBirthday(e.target.value)}
                />
                <Input 
                    name="From"
                    type="text"
                    required
                    title="Can not be empty"
                    id="From"
                    onChange={(e) => setFrom(e.target.value)}
                />
                <Input 
                    name="Password"
                    type="password"
                    required
                    title="Can not be empty"
                    id="Password"
                    onChange={(e) => setPassword(e.target.value)}
                />
                <Input 
                    name="Majors"
                    type="text"
                    required
                    title="Can not be empty"
                    id="Majors"
                    onChange={(e) => setMajors(e.target.value)}
                />
                <Input 
                    name="Maxim"
                    type="text"
                    required
                    title="Can not be empty"
                    id="Maxim"
                    onChange={(e) => setMaxim(e.target.value)}
                />
                <Input 
                    name="Describe"
                    type="text"
                    required
                    title="Can not be empty"
                    id="Describe"
                    onChange={(e) => setDescribe(e.target.value)}
                />

            </article>
            <article className={cx("itemRight")}>
                <Product name = "Job" onDataUpdate={handleJob}/>
                <Product name = "Language" onDataUpdate={handleLanguage}/>
                <Product name = "Phone" onDataUpdate={handlePhone}/>
                <Input 
                    name="CV"
                    type="file"
                    required
                    title="Can not be empty"
                    id="CV"
                    onChange={(e) => setCV(e.target.files[0])}
                />
                <Input 
                    name="Images"
                    type="file"
                    required
                    title="Can not be empty"
                    id="Images"
                    multiple
                    onChange={(e) => setImages(e.target.files)}
                />
               <Input 
                    name="Logo"
                    type="file"
                    required
                    title="Can not be empty"
                    id="Logo"
                    onChange={(e) => setLogo(e.target.files[0])}
                />      
               <Input 
                    name="IconLogo"
                    type="file"
                    required
                    title="Can not be empty"
                    id="IconLogo"
                    onChange={(e) => setIconLogo(e.target.files[0])}
                />   
                <Button
                    name="Create Account"
                    width = "30%"
                    height = "7%"
                    onClick={handleUpAccount}
                />                       
            </article>
        </form>
     );
}

export default Account;
